import React from 'react';
import './footer.css'; 
import govImg from '../../assets/gov.jpg';

const Footer = () => {
  return (
    <footer className="footer">
        <div className="map">
            <img src={govImg} alt="" className="gov" />
        </div>
        Copyright &#169; 2024 Aryan Jha. All rights received.
    </footer>
  )
}

export default Footer;
